pragma solidity ^0.5;

import "./BEP20.sol";
import "./IPancakeRouter.sol";
import "./LiquidityBackedTokenSale.sol";

contract TokenSaleRegistry {
  mapping(address  =>address payable ) currentSale ;
  address payable owner;
  IPancakeRouter02 public router;
  uint256 public fee;

  event TokenSaleCreated(address indexed creator, address indexed tokenContract, address saleContract);

  constructor(IPancakeRouter02 pancakeRouter) public {
    router=pancakeRouter;
    owner = msg.sender;
    fee=100000000000000000;
  }

  function saleStatus(address addr) public view returns (uint256,bool,bool,bool,address,uint256){
    if(address(currentSale[addr])==address(0x0)){
      return (fee,false,false,false,address(0x0),0);
    }else{
      SimpleTokenSale sale=SimpleTokenSale(currentSale[addr]);
      return (fee,true,sale.isOpen(),sale.hasClosed(),address(sale),sale.cap());

    }
  }

  function _notifySaleCreation(IERC20 token ,SimpleTokenSale tokenSale) internal{
    currentSale[address(token)]=address(tokenSale);
    emit TokenSaleCreated(msg.sender, address(token), address(tokenSale));
  }

  function createTokensale(
    uint rate, // rate in TKNbits
    IERC20 token, // token name
    address payable wallet, // company's fundraising wallet that holds ETH sent from users
    uint256 softCap, // goal of the crowdsale
    uint256 hardCap,
    uint256 liquidityTokens,
    uint256 liquidityEth,
    uint256 openingTime,
    uint256 closingTime,
    bool burnRemaining
  )  public payable {
    require(msg.value>=fee,"Registry: Insufficient fee");
    LiquidityBackedTokenSale sTokenSale = new LiquidityBackedTokenSale(rate, token, wallet, softCap,hardCap,liquidityTokens,liquidityEth, openingTime, closingTime,router,burnRemaining);
  _notifySaleCreation(token,sTokenSale);

  }
  function createStartedTokensale(
    uint rate, // rate in TKNbits
    IERC20 token, // token name
    address payable wallet, // company's fundraising wallet that holds ETH sent from users
    uint256 softCap, // goal of the crowdsale
    uint256 hardCap,
    uint256 liquidityTokens,
    uint256 liquidityEth,
    uint256 closingTime,
    bool burnRemaining
  ) public payable {
    require(msg.value>=fee,"Registry: Insufficient fee");
  LiquidityBackedTokenSale sTokenSale = new LiquidityBackedTokenSale(rate, token, wallet, softCap,hardCap,liquidityTokens,liquidityEth,block.timestamp, closingTime,router,burnRemaining);
    _notifySaleCreation(token,sTokenSale);
  }
    function withdraw() public payable{
    require(msg.sender==owner,"Registry: Only owner");
    owner.transfer(address(this).balance);
  }

  function setFee(uint256 _fee) public {
    require(msg.sender==owner,"Registry: Only owner");
    fee=_fee;
  }
}
